import React from 'react'
import insta from '../Component/Image/instagram.png'

const Home = () => {
  return (
    <>
        <header className="headerimg" style={{textAlign:'center', padding:'1rem'}}>
            <img src={insta} alt="Header logo" style={{Width:'25%'}}/>
        </header>
    </>
  )
}

export default Home
